    data: |
      SELECT - ( CAST ( 70 AS INTEGER ) ) AS col0 FROM tab2 WHERE NOT col2 * col0 + - - col0 / - CAST ( 25 AS INTEGER ) BETWEEN NULL AND + col1 OR NOT - 96 * 94 + - 8 * + 52 > - 90 - + col2 * + 8;
  - name: tab2

outputs:
  - name: q12146.out
    data: |
      -70
      -70
      -70
